import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component 
{
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo"/>
          <p>Learn React</p>
        </header>

      </div>
    );
  }
}

export default App;
